import React, { Component } from "react";
class counter extends Component {
  state = {
    count: 5,
  };
  render() {
    return (
      <div>
        <span>{this.format()}</span>
        <button onClick={this.increase()}>Increment</button>
      </div>
    );
  }
  format() {
    const count = this.state;
    return count === 0 ? "zero" : count;
  }
}

export default counter;
